import './App.css';
import React, { Component } from 'react';


class App extends React.Component {


  constructor(props) {
    super(props);
    this.state = {name: '',desc:'',type:'',fuelType:'',manu:''};

    this.handleSubmit = this.handleSubmit.bind(this);
    this.handleInputChange = this.handleInputChange.bind(this);
  }



  handleInputChange(event) {
    const target = event.target;
    const value = target.value;
    const name = target.name;

    this.setState({
      [name]: value
    });
  }

  handleSubmit(event) {
    debugger;
    event.preventDefault();
    console.log(event.target[0].value)
    console.log(this.state.name);
    console.log(this.state.desc);
    console.log(this.state.type);
    console.log(this.state.fuelType);
    console.log(this.state.manu);

  }

  render() {
    return (
      <div className="App">
        <header className="App-header">
          <h1>Add Car</h1>
        <form onSubmit={this.handleSubmit}>
    <label>
      Name:
      <input type="text" name="name" onChange={this.handleInputChange} />
    </label>
    <br></br>
    <label>
      Desc:
      <input type="text" name="desc"onChange={this.handleInputChange}  />
    </label>
    <br></br>
    <label>
      Type:
      <input type="text" name="type" onChange={this.handleInputChange} />
    </label>
    <br></br>
    <label>
      fuelType:
      <input type="text" name="fuelType" onChange={this.handleInputChange} />
    </label>
    <br></br>
    <label>
    manufacturer:
      <input type="text" name="manu"  onChange={this.handleInputChange}/>
    </label>
    <input type="submit" value="Submit" />
  </form>
        </header>
      </div>
    );
  }

}

export default App;
